import React from "react";
import styled from "@emotion/styled";
import theme from "../styles/theme";

const Profile = styled.img`
  width: ${theme.width.laptop};
  border-radius: 10px;
  margin-top: ${theme.margin.laptop};
  margin-bottom: ${theme.margin.laptop};
  @media screen and (max-width: 1400px) {
    width: ${theme.width.tablet};
  }
  @media screen and (max-width: 768px) {
    width: ${theme.width.mobile};
    margin-top: ${theme.margin.mobile};
    margin-bottom: ${theme.margin.mobile};
  }
`;

const Container = styled.article`
  width: ${theme.width.tablet};
  /* background-color: #f1f2f4; */
  align-self: center;

  @media screen and (max-width: 768px) {
    width: ${theme.width.mobile};
  }

  & header {
    margin-top: 40px;
    margin-bottom: 20px;
    & h3 {
      margin-bottom: ${theme.margin.mobile};
    }
  }

  & section {
    margin-top: 40px;
    margin-bottom: 20px;
    & p {
      margin-top: 4px;
      margin-bottom: 24px;
    }
    & h3 {
      margin-bottom: ${theme.margin.mobile};
    }
  }
`;

const Button = styled.button`
  border: none;
  background-color: #444444;
  color: white;
  & p {
    margin: 4px;
  }
`;

const About = () => {
  return (
    <main>
      <Profile src="https://i.imgur.com/4xmnZLI.png" />
      <Container>
        <header>
          <h3 className="font-gradient">"Young and be ambitious!"</h3>
          <p>I love to make impact with awesome products.</p>
          <p>
            I’m currently working as a design engineer at TNG and Product
            Designer at BE THE LIGHT
          </p>
        </header>

        <section>
          <h3>Work Experience</h3>

          <strong>May KING</strong>
          <p>Founder, Design Instructor · Jan 2018 ~ Dec 2019</p>

          <strong>TNG</strong>
          <p>Design Engineer · Jan 2020 ~ Present</p>

          <strong>BE THE LIGHT</strong>
          <p>Product Designer · Mar 2021 ~ Present</p>
        </section>

        <section>
          <h3>Skills</h3>
          <div>
            <strong>Design Engineering</strong>
            <Button>
              <p>Solidworks</p>
            </Button>
            <Button>
              <p>Fusion 360</p>
            </Button>
            <Button>
              <p>Ansys Maxwell</p>
            </Button>
            <Button>
              <p>Keyshot</p>
            </Button>
          </div>
          <div>
            <strong>Coding</strong>
            <Button>
              <p>Javascript</p>
            </Button>
            <Button>
              <p>Python</p>
            </Button>
            <Button>
              <p>SwiftUI</p>
            </Button>
          </div>
          <div>
            <strong>Digital Product Design</strong>
            <Button>
              <p>Adobe XD</p>
            </Button>
            <Button>
              <p>Figma</p>
            </Button>
            <Button>
              <p>Adobe After Effets</p>
            </Button>
            <Button>
              <p>ProtoPie</p>
            </Button>
          </div>
        </section>

        <section>
          <h3>Clients worked with</h3>

          <strong>KITECH</strong>
          <p>ALD Equipments design engineering, Patent</p>

          <strong>Gaon Tech</strong>
          <p>Fire Alarm design</p>

          <strong>ADM Tech</strong>
          <p>Mask design</p>
        </section>
      </Container>
    </main>
  );
};

export default About;
